let candle = record.current
let volume = getElement('volumes', candle)
let len = 14 //length for sma calculation at Money Flow Ratio calculation
let FTs = 10 //sampling for the Fisher Transform


//calculate and store High Low Close average
variable.HLC.push((candle.max + candle.min + candle.close)/3)
if(variable.HLC.length > 2){
	variable.HLC.splice(0,1)
}

//raw moneyflow calculation
variable.RMF = (candle.max + candle.min + candle.close)/3 * (volume.buy + volume.sell)

//initializing Positive and Negative mone flow
if(variable.posMF === undefined){
		variable.posMF =0
}
if(variable.negMF === undefined){
		variable.negMF =0
}

//Positive Money flow calculation
if (variable.HLC[1] > variable.HLC[0]){
	variable.posMF = variable.posMF + variable.RMF
}
variable.PMF.push(variable.posMF) //store Positive money FLow for SMA calculation
if(variable.PMF.length > len){
	variable.PMF.splice(0,1)
}

//Negative Money flow calculation
if (variable.HLC[1] < variable.HLC[0]){
	variable.negMF = variable.negMF + variable.RMF
}
variable.NMF.push(variable.negMF) //store Negative money FLow for SMA calculation
if(variable.NMF.length > len){
	variable.NMF.splice(0,1)
}

//calculating SMA of nef and pos money flow
variable.sPMF = 0
variable.sNMF = 0
if(variable.NMF.length === len && variable.PMF.length === len){
	for(var i = 0 ; i < len ; i++) {
		variable.sPMF = variable.sPMF + variable.PMF[i]
		variable.sNMF = variable.sNMF + variable.NMF[i]
	}
	variable.smaPMF = variable.sPMF / len
	variable.smaNMF = variable.sNMF / len

	variable.MFR = variable.smaPMF / variable.smaNMF //Money FLow ratio
	variable.MFI = 100 - 100 /(1 + variable.MFR) //Money Flow Index
}

//handle initialization, undefined and NaN values at MFI
if(variable.MFI === undefined || isNaN(variable.MFI)){
	variable.MFI = 100
}
//store MFI values on th sampling range
variable.allMFI.push(variable.MFI)
if(variable.allMFI.length > FTs){
	variable.allMFI.splice(0,1)
}

//Procedure for Fisher Transform
//finding max and min MFI on the sampling range
variable.High = Math.max.apply(Math,variable.allMFI)
variable.Low = Math.min.apply(Math,variable.allMFI)

if(variable.prevValue === undefined) {
	variable.prevValue = 0
}
variable.Value = round(0.66 * ((variable.MFI - variable.Low)/ Math.max(variable.High - variable.Low, 0.001) - 0.5) + 0.67 + variable.prevValue)
variable.preValue = variable.Value

if(variable.prevFisher === undefined){
	variable.prevFisher = 0
}
variable.Fisher = 0.5 * Math.log((1 + variable.Value) / Math.max(1 - variable.Value,0.001)) + 0.5 * variable.prevFisher
if (isNaN(variable.Fisher)){
	variable.Fisher = 0
}
variable.Trigger = variable.prevFisher
variable.prevFisher = variable.Fisher


//Functions definition
//Round Function
function round(val){
	if(val > 0.99) {
		variable.v = 0.999
	}
	else {
		variable.v=val
	}
	if(val < -0.99){
		variable.v = -0.999
	}
	else {
		variable.v=val
	}
	return variable.v

}

let candle = record.current //define candle pointer
let v = 1 // variance for the gaussian distributed random number -- higer is better but in order to keep reasonable computing time it should not exceed 5
let iter = 10000 // number of iteration of the Monte Carlo simulation

//initialize lastClose array to avoid undefined or 0 value
if(variable.lastClose.length === 0 ){
	variable.lastClose.push(candle.close)
}

//fetch candle clos and previous candle close in an array
variable.lastClose.push(candle.close) 
if(variable.lastClose.length > 2) {
	variable.lastClose.splice(0,1)
}

//calculate and store Periode Daily Return on all time periods
variable.PDR.push(Math.log(variable.lastClose[1] / variable.lastClose[0]))

//statistic calculations of PDR
variable.totalPDR = 0
for(j=0 ; j < variable.PDR.length ; j++){
	variable.totalPDR += variable.PDR[j]
}
variable.avgPDR = variable.totalPDR / variable.PDR.length //average PDR

variable.prodvar = 0
		//variance and standard deviation calculations
for( var j = 0 ; j < variable.PDR.length ; j++){
	variable.prodvar = variable.prodvar + Math.pow(variable.PDR[j] - variable.avgPDR,2)
}

variable.varPDR = variable.prodvar / variable.PDR.length //variance
variable.sigPDR = Math.sqrt(variable.varPDR) //standard deviation

//Drift calculation
variable.drift = variable.avgPDR - variable.varPDR / 2

//Futur price array over iter number of values
variable.frct = []
for(var j = 0 ; j < iter ; j++){
	variable.frct.push(candle.close * Math.exp(variable.drift + random(v) * variable.sigPDR))
}

//average of futur price
variable.totalFRCT = 0
for(j=0 ; j < variable.frct.length ; j++){
	variable.totalFRCT += variable.frct[j]
}
variable.futur = variable.totalFRCT / variable.frct.length

//standard deviation of futur price
variable.prodvar = 0
for(var j = 0 ; j < variable.frct.length ; j++){
	variable.prodvar = variable.prodvar + Math.pow(variable.frct[j] - variable.futur,2)
}
variable.varFRCT = variable.prodvar / variable.PDR.length //variance
variable.stdF = Math.sqrt(variable.varFRCT) //standard deviation

//price at 1% probability
variable.price1 = variable.stdF * 2.34  + variable.futur
variable.price1d = variable.futur - variable.stdF * 2.34  
//price at 5% probability
variable.price5 = variable.stdF * 1.64  + variable.futur
variable.price5d = variable.futur - variable.stdF * 1.64  
//price at 10% probability
variable.price10 = variable.stdF * 1.28  + variable.futur
variable.price10d = variable.futur - variable.stdF * 1.28  
//price at 20% probability
variable.price20 = variable.stdF * 0.84  + variable.futur
variable.price20d = variable.futur - variable.stdF * 0.84  
//price at 30% probability
variable.price30 = variable.stdF * 0.525  + variable.futur
variable.price30d = variable.futur - variable.stdF * 0.525  
//price at 40% probability
variable.price40 = variable.stdF * 0.25  + variable.futur
variable.price40d = variable.futur - variable.stdF * 0.25  
//price at 45% probability
variable.price45 = variable.stdF * 0.125  + variable.futur
variable.price45d = variable.futur - variable.stdF * 0.125  

//Futur Begin and End
variable.BeginF = candle.begin + (candle.end - candle.begin)
variable.EndF = candle.end + (candle.end - candle.begin)

//function declaration
 //gaussian distributed random number generation
 function random(va){
	 var r = 0
	 for(var i = va ; i>0 ; i--){
		 r += Math.random()
	 }
	 return r/va
 }

/* Loop Code */
// * NOTE * - Lookback to start is 6 - That means 6 previous before current.
let candle = record.current;

let hl2 = (candle.max + candle.min) / 2;  // (high + low) / 2
let hl2ArrLen = variable.hl2Arr.push(hl2);
if (hl2ArrLen > 16) {
    variable.hl2Arr.splice(0, 13);  // Bring back to length == 4
    hl2ArrLen = variable.hl2Arr.length;
}

if (hl2ArrLen < 4) {
    variable.mama = 0;
    variable.fama = 0;
} else {
    let sp = ( (4 * hl2) +
        (3 * variable.hl2Arr[hl2ArrLen-2]) +
        (2 * variable.hl2Arr[hl2ArrLen-3]) +
        (variable.hl2Arr[hl2ArrLen-4])) / 10;

    let spArrLen = variable.spArr.push(sp);
    if (spArrLen > 16) {
        variable.spArr.splice(0,10);
        spArrLen = variable.spArr.length;
    }

    let dt = (.0962 * sp +
            .5769 * variable.spArr[spArrLen-3] -
            .5769 * variable.spArr[spArrLen-5] -
            .0962 * variable.spArr[spArrLen-7]) *
            (.075 * variable.pPrev + .54);
    let dtArrLen = variable.dtArr.push(dt);
    if (dtArrLen > 16) {
        variable.dtArr.splice(0,10);
        dtArrLen = variable.dtArr.length;
    }

    let q1 = (.0962 * dt +
            .5769 * variable.dtArr[dtArrLen-3] -
            .5769 * variable.dtArr[dtArrLen-5] -
            .0962 * variable.dtArr[dtArrLen-7]) *
            (.075 * variable.pPrev + .54);
    let q1ArrLen = variable.q1Arr.push(q1);
    if (q1ArrLen > 16) {
        variable.q1Arr.splice(0,10);
        q1ArrLen = variable.q1Arr.length;
    }

    let i1 = variable.dtArr[dtArrLen-4];
    let i1ArrLen = variable.i1Arr.push(i1);
    if (i1ArrLen > 16) {
        variable.i1Arr.splice(0,10);
        i1ArrLen = variable.i1Arr.length;
    }

    let jI = (.0962 * i1 +
            .5769 * variable.i1Arr[i1ArrLen-3] -
            .5769 * variable.i1Arr[i1ArrLen-5] -
            .0962 * variable.i1Arr[i1ArrLen-7]) *
            (.075 * variable.pPrev + .54);

    let jq = (.0962 * q1 +
            .5769 * variable.q1Arr[q1ArrLen-3] -
            .5769 * variable.q1Arr[q1ArrLen-5] -
            .5769 * variable.q1Arr[q1ArrLen-7]) *
            (.075 * variable.pPrev + .54);

    let i2_ = i1 - jq;
    let q2_ = q1 + jI;
    let i2 = .2 * i2_ + .8 * variable.i2Prev;
    let q2 = .2 * q2_ + .8 * variable.q2Prev;
    let re_ = i2 * variable.i2Prev + q2 * variable.q2Prev;
    let im_ = i2 * variable.q2Prev - q2 * variable.i2Prev;
    let re = .2 * re_ + .8 * variable.rePrev;
    let im = .2 * im_ + .8 * variable.imPrev;

    let p1 = (im != 0 && re != 0) ? (360/Math.atan(im/re)) : variable.pPrev;

    let p2 = (p1 > (1.5 * variable.p1Prev)) ? 
            (1.5 * variable.p1Prev) :
            (p1 < 0.67 * variable.p1Prev) ?
            (0.67 * variable.p1Prev) : p1;

    let p3 = (p2 < 6) ? 6 :
            (p2 > 50) ? 50 : p2;

    let p = .2 * p3 + .8 * variable.p3Prev;

    let spp = .33 * p + .67 * variable.sppPrev;
    let phase = Math.atan(q1 / i1);
    let dphase_ = variable.phasePrev - phase;
    let dphase = (dphase_ < 1) ? 1 : dphase_;
    let alpha_ = variable.fastLimit / dphase;

    let alpha = (alpha_ < variable.slowLimit) ?
                variable.slowLimit :
                (alpha_ > variable.fastLimit) ?
                variable.fastLimit : alpha_;

    /* mama && fama variable declarations: */            
    variable.mama = alpha * hl2 + (1 - alpha) * variable.mamaPrev;
    variable.fama = .5 * alpha * variable.mama + (1 - .5 * alpha) * variable.famaPrev;

    /* Load up variable.Prevs */
    variable.pPrev = p;
    variable.i2Prev = i2;
    variable.q2Prev = q2;
    variable.rePrev = re;
    variable.imPrev = im;
    variable.p1Prev = p1;
    variable.p3Prev = p3;
    variable.sppPrev = spp;
    variable.phasePrev = phase;
    variable.mamaPrev = variable.mama;
    variable.famaPrev = variable.fama;
}

if (!isFinite(variable.mama)) {
    variable.mama = (isFinite(variable.mamaPrev) ? variable.mamaPrev :
    ((candle.close + candle.max + candle.min) / 3));
}
if (!isFinite(variable.fama)) {
    variable.fama = (isFinite(variable.famaPrev) ? variable.famaPrev :
    ((candle.close + candle.max + candle.min) / 3));
}
variable.closePrice = candle.close;

/* Initialization Code */
variable.fastLimit = 0.375;  // Orig Setting:0.5
variable.slowLimit = 0.0375; // Orig Setting:0.05
variable.hl2Arr = [];        // Max Length == 16
variable.spArr = [0,0,0,0,0,0];         // Max Length == 16
variable.dtArr = [0,0,0,0,0,0];         // Max Length == 16
variable.q1Arr = [0,0,0,0,0,0];         // Max Length == 16
variable.i1Arr = [0,0,0,0,0,0];         // Max Length == 16
variable.pPrev = 0;
variable.i2Prev = 0;
variable.q2Prev = 0;
variable.rePrev = 0;
variable.imPrev = 0;
variable.p1Prev = 0;
variable.p3Prev = 0;
variable.sppPrev = 0;
variable.phasePrev = 0;
variable.mamaPrev = 0;
variable.famaPrev = 0;

let candle = record.current
let MAMA_PLUV = getElement('MAMAs', candle)
let P = 10 //periodes for ATR calculation

//True range
variable.TR.push(Math.max((candle.max - candle.min), Math.abs(candle.max - candle.close),Math.abs(candle.min-candle.close)))
if(variable.TR.length > P) {
	variable.TR.splice(0,1)
}

//ATR
variable.ATR = 0
for(var i=0 ; i < variable.TR.length ; i++){
		variable.ATR += variable.TR[i]
}

//put your mama in a local variable... 
if(MAMA_PLUV.mama === undefined){
	variable.MAMA = candle.close
}
else {
	variable.MAMA = MAMA_PLUV.mama
}
//calculate Upper and Lower Band for Keltner channels
if(variable.ATR === undefined || isNaN(variable.ATR)){
	variable.Upper = variable.MAMA
	variable.Lower = variable.MAMA
}
else{
	variable.Upper = variable.MAMA + 2 * variable.ATR
	variable.Lower = variable.MAMA - 2* variable.ATR
}
